import React, { useState } from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

import Home from "./pages/Home.js";
import '@fortawesome/fontawesome-free/css/all.min.css'; // Import Font Awesome


function App() {

  return (
      <BrowserRouter>
          <Routes>
            <Route
              path="/"
              element={
                  <Home/>
              }
            />
          
          </Routes>
      </BrowserRouter>
  );
}

export default App;
